import React from 'react';
import { useTranslation } from 'react-i18next';

const TranslationTest: React.FC = () => {
  const { t, i18n } = useTranslation();

  return (
    <div style={{ 
      position: 'fixed', 
      top: '10px', 
      right: '10px', 
      background: 'red', 
      color: 'white', 
      padding: '10px', 
      zIndex: 9999,
      fontSize: '12px'
    }}>
      <div>Current Language: {i18n.language}</div>
      <div>URL: {window.location.pathname}</div>
      <div>EN Title: {t('home.meta.title', { lng: 'en' })}</div>
      <div>DE Title: {t('home.meta.title', { lng: 'de' })}</div>
    </div>
  );
};

export default TranslationTest;
